proxy-groups:

  - name: "Getafreenode"
    type: select
    proxies:
      - GetAFreeNode.com-Kansas
      - GetAFreeNode.com-LosAngeles

  - name: "RaceVPN"
    type: select
    proxies:
      - KZ Racevpn
      - FR Racevpn
      - FR2 Racevpn
      - AU2 Racevpn
      - AU Racevpn
      - CA2 Racevpn
      - CA Racevpn
      - SE Racevpn
      - DE Racevpn
      - DE2 Racevpn
      - DE3 Racevpn
      - US Racevpn
      - US2 Racevpn
      - US3 Racevpn
      - NL Racevpn
      - NL2 Racevpn
      - NL3 Racevpn
      - UK Racevpn
      - UA Racevpn
      - TR Racevpn
      - TR Racevpn

  - name: "vpn.fail"
    type: select
    proxies:
      - Octavi
      - Ophelia
      - Odelia
      - Waynn
      - Alvvin
      - Oliv
      - Universal

  - name: "VPNJANTIT"
    type: select
    proxies:
      - UAE vpnjantit
      - UK2 vpnjantit
      - UA1 vpnjantit
      - UA3 vpnjantit

  - name: "Globalssh"
    type: select
    proxies:
      - DE Globalssh
      - US Globalssh

rules:
  - MATCH,Getafreenode
  - MATCH,RaceVPN
  - MATCH,vpn.fail
  - MATCH,VPNJANTIT
  - MATCH,Globalssh
